import React from 'react';
import '../styles/Home.css';


const Home = () => {
  return (
    <div className="home">
      <div className='rectangle-background'>
          <h2>Lucila</h2>
          <span>&</span>
          <h2>Luciano</h2>
          <p>"Y mis ojos, versus su sonrisa, <br/> terminaron por tirar la fachada"</p>
      </div>
    </div>
  )
}

export default Home
